\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n</p><p class=\"MsoNormal\"><span style=\"font-family:宋体;mso-ascii-font-family:Calibri;\nmso-ascii-theme-font:minor-latin;mso-fareast-font-family:宋体;mso-fareast-theme-font:\nminor-fareast;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin\">您同意免除</span><span lang=\"EN-US\">IPEX</span><span style=\"font-family:宋体;mso-ascii-font-family:Calibri;\nmso-ascii-theme-font:minor-latin;mso-fareast-font-family:宋体;mso-fareast-theme-font:\nminor-fareast;mso-hansi-font-family:Calibri;mso-hansi-theme-font:minor-latin\">及其所有关联公司因您使用我们的服务违反这些条款以及由于您侵犯任何其他人或实体的权利而导致的一切诉讼、索赔、损害、损失或要求的责任。</span></p>','2019-08-06 06:36:05','',NULL,0,0,1,'用户协议'),(2,'admin','<p>全球专业站法币OTC平台</p><p><br></p><p>为了保障交易双方的安全、增强本平台注册用户身份的可信度，本平台向您提供商家认证服务。您必须提供必要的真实个人信息以完成认证，本平台有权采取各种合法措施对您所提供的信息进行核验，但是由于网络环境的虚拟性及核验方法限制，本平台对完成认证的商家身份的准确性和真实性不做任何保证。</p><p><br></p><p>本协议所有内容中相关条款与您的权利和义务密切相关，请您在开始申请认证商家前，仔细阅读本协议的所有内容，一旦您开始认证流程，即表示您知悉并已充分理解，且同意接受本协议的全部内容。</p><p><br></p><p>一、 认证服务的定义与变更</p><p><br></p><p>1.认证服务是在商家提供真实可信的身份信息，交纳一定保证金后，在本平台享有一定特权并承担一定义务的服务。除非发生法定情形或者本协议另有约定，一旦您在本平台完成了认证，相应的身份信息和认证结果将不因任何原因被修改或取消；如果您的身份信息在完成认证后发生了变更，您应向本平台提供相应有权部门出具的凭证，由本平台协助您变更您的认证信息。&nbsp;</p><p><br></p><p>2.出于提供更优质服务及保障交易安全的需要，本平台有权根据主客观情况的变化，对本协议内容进行修改或调整，并通过本平台公告变更后的协议文本，无需单独通知您。本协议进行任何修改或变更后，您还继续使用本平台提供的服务，即代表您已阅读、了解并同意接受变更后的协议内容；您如果不同意变更后的协议内容，应立即向本台申请停用认证服务。&nbsp;</p><p><br></p><p>二、 认证商家权利</p><p><br></p><p>1.本平台将向申请认证成功的商家提供特有的认证商家标识，该标识在本平台可与未认证的商家进行区分；&nbsp;</p><p><br></p><p>2.在本平台发布符合规定的交易广告信息。&nbsp;</p><p><br></p><p>三、认证所需资料及保证金</p><p><br></p><p>1.商家个人信息：请将附件商家申请资料内容填写完整并上传。&nbsp;</p><p><br></p><p>2.资产保证金：申请成为认证商家需要向本平台缴纳一定的保证金。保证金将被划至认证商家所属的保证金账户。认证商家在一定期间内无法对该账户内资金无法进行交易或划转。&nbsp;</p><p><br></p><p>四、认证资料的使用</p><p><br></p><p>认证资料的报告：您在认证时提交给本平台的认证资料，即不可撤销地授权由本平台保留。除法定或本协议约定的情形外，本平台承诺，不编辑或对任何第三方公开您的认证资料，且不将其用于商业目的，但以下情形除外：&nbsp;</p><p><br></p><p>1.您授权本平台透露的相关信息;</p><p><br></p><p>2.本平台向国家司法及行政机关提供;</p><p><br></p><p>3.本平台向本平台关联企业提供;</p><p><br></p><p>4.第三方和本平台一起为用户提供服务时，该第三方向您提供服务所需的相关信息（不包括您的银行账户信息）;</p><p><br></p><p>5.基于解决您与第三方民事纠纷的需要，本平台有权向该第三方提供您的身份信息。</p><p><br></p><p>五、关于保证金的使用</p><p><br></p><p>保证金系用于保障在本平台进行的相关交易的安全。如您在交易过程中发生纠纷，且被判定应对纠纷承担责任并履行相应行为，而您不予配合，本平台有权力对保证金进行处置，处置措施包括但不限于扣留、冻结，或向您的交易对手直接支付。&nbsp;</p><p><br></p><p>六、第三方网站的链接</p><p><br></p><p>为实现身份信息审查，本平台上可能包含指向第三方网站（如网上银行网站）的链接（以下简称“链接网站”）。 “链接网站”非由本平台控制，对于任何“链接网站”的内容，包含但不限于“链接网站”内含的任何链接，或“链接网站”的任何改变或更新，本平台均不予负责。自“链接网站”接收的网络传播或其它形式之传送，本平台不予负责。&nbsp;</p><p><br></p><p>七、不得为非法或禁止的使用</p><p><br></p><p>接受本协议全部的说明、条款、条件是您申请认证的前提条件。您声明并保证，您不得为任何非法或为本协议、条件及须知所禁止之目的进行认证申请。您不得以任何可能损害、使瘫痪、使过度负荷或损害其他网站或其他网站的服务或本平台或干扰他人对于认证商家申请的使用等方式使用认证服务。您不得经由非本平台许可提供的任何方式取得或试图取得任何资料或信息&nbsp;</p><p><br></p><p>八、免责条款</p><p><br></p><p>下列情况导致的个人资料、信息泄露，本平台无需承担任何责任：&nbsp;</p><p><br></p><p>1.由于您将账户密码告知他人或未保管好自己的密码或与他人共享账户或任何其他非本平台的过错，导致您的个人资料泄露。</p><p><br></p><p>2.任何由于黑客攻击、计算机病毒侵入或发作、电信部门技术调整导致之影响、因政府政策或法律管制而造成的关闭、由于第三方原因(包括不可抗力，例如国际出口的主干线路及国际出口电信提供商一方出现故障、火灾、水灾、雷击、地震、洪水、台风、龙卷风、火山爆发、瘟疫和传染病流行、罢工、战争或暴力行为或类似事件等)及其他非因本平台过错而造成的认证信息泄露、丢失、被盗用或被篡改等。&nbsp;</p><p><br></p><p>3.由于与本平台链接的其它网站（如网上银行等）所造成的银行账户信息泄露及由此而导致的任何法律争议和后果。</p><p><br></p><p>4.任何因用户向本平台提供错误、不完整、不实信息等造成不能通过认证或遭受任何其他损失，概与本平台无关。</p><p><br></p><p>九、特别声明</p><p><br></p><p>1.本平台对认证商家进行的基本资料审查和保证金要求，并不代表认证商家100%可信，也不代表本平台与认证商家之间存在任何保证关系。请本平台用户严格按照流程交易，做好对交易方的资料审核，详尽沟通，保证自身的交易和资产安全！同时，基于数字资产交易的特殊性，您需要在反洗钱方面的风险格外注意，按照KYC原则的要求对您交易对方的身份进行了解，否则您将可能因交易对方涉嫌犯罪而面临资产冻结等风险。&nbsp;</p><p><br></p><p>2.认证商家承诺其向本平台提供的信息是真实合法的，如有虚假或违法，本平台可取消其认证，并扣留其保证金。</p><p><br></p><p>十、认证解除</p><p><br></p><p>如认证商家需要解除认证，须向本平台提交申请。如认证商家在认证期间无不良记录、影响交易安全或其他违法违规的行为,本平台将于收到申请后两个工作日内审核通过，并将保证金账户内资金划转至需解除认证商家的可操作账户中。</p>','2019-08-06 06:37:44','',NULL,0,0,1,'认证商家协议');

